import { Navbar, Logo, ThemeToggle, UList, ListElement } from "./NavStyles";
import ThemeLogo from "./themes.png";
import BrandLogo from "./Ray M Gumbo.png";

function Nav() {
    return (
        <Navbar>
            <Logo src={BrandLogo} alt="Logo"/>
            <UList>
                <ListElement>Home</ListElement>
                <ListElement>My Expertise</ListElement>
                <ListElement>Certifications</ListElement>
                <ListElement>Projects</ListElement>
                <ListElement>Contact</ListElement>
            </UList>
            <ThemeToggle src={ThemeLogo} alt="Theme"/>
        </Navbar>
    )
}

export default Nav;
